import { Box, Typography } from "@mui/material";
import React from "react";

function ChooseUs() {
  return (
    <Box sx={{ justifyContent: "center" }}>
      {/* <Typography
        sx={{
          fontSize: "2.25rem",
          lineHeight: "2.5rem",
          fontWeight: "900",
          fontStyle: "Manrope, sans-serif",
          margin: "30px",
          padding: "30px",
          textAlign:'center'
        }}
      >
        Why Choose Us
      </Typography> */}
      <Typography
        sx={{
          fontFamily: "Manrope, sans-serif !important",
          padding: 5,
          marginTop: "40px",
          marginLeft: "470px",
          //   textAlign: "center",
          fontSize: "2.3rem",
          fontWeight: "700",
          color: "black",
          lineHeight: 1.2,
          position: "relative",
          display: "inline-block",
          "&::after": {
            content: '""',
            position: "absolute",
            right: 40,
            borderRadius: "5px",
            bottom: "35px",
            width: "150px",
            height: "4px",
            backgroundColor: "#3593b0",
          },
        }}
      >
        Why Choose Us
      </Typography>

      <Box
        sx={{
          display: "flex",
          justifyContent: "center",
          gap: 15,
          marginTop: "45px",
        }}
      >
        <Box sx={{ textAlign: "left" }}>
          <Typography
            variant="h3"
            sx={{
              fontSize: "1.875rem",
              lineHeight: "2.25rem",
              fontWeight: "700",
              mb: 2,
            }}
          >
            Fast Disbursal
          </Typography>
          <Typography
            variant="body2"
            sx={{
              fontWeight: "500",
              fontSize: "1.5rem",
              lineHeight: "2rem",
              color: "#575757",
              whiteSpace: "pre-line",
              mb: 5,
            }}
          >
            Our team helps customers <br></br>
            make informed loan <br></br>
            decisions.
          </Typography>
          <img
            src="/choose/choose2.jpg"
            alt="choose2"
            style={{
              boxShadow: "12px 12px 40px rgba(221, 220, 220, 0.4)",
              borderRadius: "50px",
            }}
          />

          <Typography
            variant="h3"
            sx={{
              fontSize: "1.875rem",
              lineHeight: "2.25rem",
              fontWeight: "700",
              mt: 4,
              mb: 2,
            }}
          >
            Personalised
          </Typography>

          <Typography
            variant="body1"
            sx={{
              fontWeight: "500",
              fontSize: "1.5rem",
              lineHeight: "2rem",
              color: "#575757",
              whiteSpace: "pre-line",
              mb: 2,
            }}
          >
            We curate the best available <br></br>
            offers from banks, NBFCs & <br></br>
            financial institutions
          </Typography>
        </Box>

        <Box
          sx={{
            display: "flex",
            flexDirection: "column",
            alignItems: "center",
            height: 400, // Adjust height as needed
            justifyContent: "space-between",
            padding: "10px",
            marginTop: "40px",
          }}
        >
          {/* First Circle */}
          <Box
            sx={{
              width: 50,
              height: 50,
              backgroundColor: "#4FACCA",
              borderRadius: "50%",
            }}
          />

          {/* Vertical Line */}
          <Box sx={{ width: 4, height: 90, backgroundColor: "#e5e7eb" }} />

          {/* Second Circle */}
          <Box
            sx={{
              width: 50,
              height: 50,
              backgroundColor: "#64B59F",
              borderRadius: "50%",
            }}
          />

          {/* Vertical Line */}
          <Box sx={{ width: 4, height: 90, backgroundColor: "#e5e7eb" }} />

          {/* Third Circle */}
          <Box
            sx={{
              width: 50,
              height: 50,
              backgroundColor: "#4FACCA",
              borderRadius: "50%",
            }}
          />
        </Box>

        <Box sx={{ textAlign: "left" }}>
          <img src="/choose/choose1.jpg" alt="choose1" />

          <Typography
            variant="h3"
            sx={{
              fontSize: "1.875rem",
              lineHeight: "2.25rem",
              fontWeight: "700",
              mt: 4,
              mb: 2,
            }}
          >
            Safe & Secure
          </Typography>
          <Typography
            variant="body1"
            sx={{
              fontWeight: "500",
              fontSize: "1.5rem",
              lineHeight: "2rem",
              color: "#575757",
              whiteSpace: "pre-line",
              mb: 4,
            }}
          >
            Applying for loans and credit cards <br></br>
            through MyMoneyMantra is <br></br>
            100% safe and secure.
          </Typography>
          <img src="/choose/choose3.jpg" alt="choose3" />
        </Box>
      </Box>
    </Box>
  );
}

export default ChooseUs;
